jobs_text:
"Hi 
For a research project, I am needing to extract data from the Amazon Seller Central Forum ("ASCF" -  ) USA and three Reddit channels (r/FulfillmentByAmazon; r/AmazonSeller; r/AmazonSellerAbuse) 
The data to extract is  
a) Name of topic/post;  
b) # of views (ASCF only);  
c) # of votes (reddit only);  
d) # of comments;  
e) timestamp 
I do NOT need the body/content of the post. 
I need to extract all the data from the first post up to 10 February 2022 
Would be willing to hear budgets proposals. 
Thanks,"
